import React, { Component } from 'react';

import '../css/cssPageLogin.css';
import { Redirect } from 'react-router-dom';
import { ContextoUsuario } from '../components/Session';


export default class PageUsuarioLog extends Component {
    
    static contextType = ContextoUsuario;

    state = {
        user : {},
        redireciona : false
    }

    componentDidMount() {
        this.setState({
            user : this.context.usuarioAutenticado
        });
    }

    redireciona = ()=> {
        if(!this.state.redireciona) {
            return;
        }

        return <Redirect  to={`/`} />;
    }

    render() {
        const { user } = this.state;

        return (
            <div className="login-main-container">
                {this.redireciona()}
                <header>
                    <ul>
                        <li>Perfil</li>
                        <li>Endereco de Entrega</li>
                        <li>Pedidos</li>
                    </ul>
                </header>
                <hr/>
                <div className="login-container">
                    <h3>Dados Cadastrais</h3>
                    <hr/>
                    <p><strong>Nome Completo</strong></p>
                    <p>{user.nome}</p>
                    <p><strong>E-mail</strong></p>
                    <p>{user.email}</p>
                    <p><strong>CPF</strong></p>
                    <p>{user.cpf}</p>
                    <p><strong>ID</strong></p>
                    <p>{user.id}</p>
                    <h3>Contato</h3>
                    <hr/>
                    <p><strong>Telefone</strong></p>
                    <p>{user.telefone}</p>
                </div>
            </div>
        );
    };

}
